const INITIAL_STATE = {
    currentState: null,
}

const UserReducer = (state = INITIAL_STATE, action) => {
    switch (action.type) {
        case 'SET_CURRENT_USER':
            return {
                ...state,
                currentState: action.payload
            };
        default:
            return state;
    }
}

export default UserReducer;
